import React from 'react';

import ManagementPage from './pages/ManagementPage';
import AnalyticsPage from './pages/AnalyticsPage';

export default function App() {
  const [route, setRoute] = React.useState('management');
  return (
    <div className="p-4">
      <header className="mb-4">
        <button onClick={() => setRoute('management')} className="mr-2">Management</button>
        <button onClick={() => setRoute('analytics')}>Analytics</button>
      </header>
      {route === 'management' ? <ManagementPage /> : <AnalyticsPage />}
    </div>
  );
}
